import React from 'react';
import './App.css';
// import CounterDisplay from './Counter';

function imprimeClick1() {
  console.log('Botão 1')
}

function imprimeClick2() {
  console.log('Botão 2')
}

function imprimeClick3() {
  console.log('Botão 3')
}

class App extends React.Component {
  render() {
    return <div> 
      <button onClick={imprimeClick1} >Botão 1</button>
      <button onClick={imprimeClick2} >Botão 2</button>
      <button onClick={imprimeClick3} >Botão 3</button>
    </div>
  }
}
export default App;
